import { Button } from '@material-ui/core';
import React from 'react'
import Photo from "./clipart4548222.png"

const Login = () => {
    return (
        <div className="login">
            <div>
                <img src={Photo} alt="" width="30%" />
            </div>
            <Button>
                  Sign in
              </Button>
        </div>
    )
}

export default Login;
